// components/Symptoms.js
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

function Symptoms() {
  const [symptoms, setSymptoms] = useState([]);
  const [age, setAge] = useState("");
  const [sex, setSex] = useState("");
  const [loading, setLoading] = useState(false);
  const [result, setResult] = useState(null);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  // Common symptoms list
  const commonSymptoms = [
    { id: "s_47", name: "Headache" },
    { id: "s_13", name: "Fever" },
    { id: "s_21", name: "Cough" },
    { id: "s_98", name: "Fatigue" },
    { id: "s_156", name: "Nausea" },
    { id: "s_81", name: "Sore Throat" },
    { id: "s_44", name: "Chest Pain" },
    { id: "s_102", name: "Back Pain" },
    { id: "s_88", name: "Difficulty Breathing" },
  ];

  const handleSymptomSelect = (symptomId) => {
    setSymptoms((prev) => {
      if (prev.includes(symptomId)) {
        return prev.filter((id) => id !== symptomId);
      }
      return [...prev, symptomId];
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);

    // Simulate API call (replace with actual Infermedica API when you have credentials)
    try {
      // Simulated response
      setTimeout(() => {
        setResult({
          conditions: [
            {
              id: "c_1",
              name: "Common Cold",
              probability: 0.67,
              recommendation: "Rest and monitor symptoms",
            },
            {
              id: "c_2",
              name: "Seasonal Allergies",
              probability: 0.45,
              recommendation: "Consider over-the-counter antihistamines",
            },
          ],
        });
        setLoading(false);
      }, 1500);
    } catch (err) {
      setError("Failed to process symptoms. Please try again.");
      setLoading(false);
    }
  };

  return (
    <div className="min-h-screen bg-gray-100 py-6">
      <div className="max-w-3xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="bg-white shadow-lg rounded-lg overflow-hidden">
          <div className="px-4 py-5 sm:p-6">
            <h1 className="text-3xl font-bold text-gray-900 mb-6">
              Symptom Checker
            </h1>

            {error && (
              <div className="mb-4 bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded">
                {error}
              </div>
            )}

            <form onSubmit={handleSubmit} className="space-y-6">
              {/* Basic Information */}
              <div className="grid grid-cols-1 gap-6 sm:grid-cols-2">
                <div>
                  <label className="block text-sm font-medium text-gray-700">
                    Age
                  </label>
                  <input
                    type="number"
                    value={age}
                    onChange={(e) => setAge(e.target.value)}
                    className="mt-1 block w-full rounded-md border border-gray-300 shadow-sm p-2"
                    required
                    min="0"
                    max="130"
                  />
                </div>
                <div>
                  <label className="block text-sm font-medium text-gray-700">
                    Sex
                  </label>
                  <select
                    value={sex}
                    onChange={(e) => setSex(e.target.value)}
                    className="mt-1 block w-full rounded-md border border-gray-300 shadow-sm p-2"
                    required
                  >
                    <option value="">Select...</option>
                    <option value="male">Male</option>
                    <option value="female">Female</option>
                  </select>
                </div>
              </div>

              {/* Symptoms Selection */}
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-2">
                  Select Your Symptoms
                </label>
                <div className="grid grid-cols-1 sm:grid-cols-2 gap-2">
                  {commonSymptoms.map((symptom) => (
                    <label
                      key={symptom.id}
                      className="flex items-center space-x-2 p-2 border rounded hover:bg-gray-50"
                    >
                      <input
                        type="checkbox"
                        checked={symptoms.includes(symptom.id)}
                        onChange={() => handleSymptomSelect(symptom.id)}
                        className="rounded text-blue-500"
                      />
                      <span>{symptom.name}</span>
                    </label>
                  ))}
                </div>
              </div>

              <button
                type="submit"
                disabled={loading || !age || !sex || symptoms.length === 0}
                className="w-full flex justify-center py-2 px-4 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-red-400 hover:bg-red-500 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-red-500 disabled:bg-gray-400"
              >
                {loading ? "Processing..." : "Check Symptoms"}
              </button>
            </form>

            {/* Results Display */}
            {result && (
              <div className="mt-6 p-4 border rounded-lg">
                <h2 className="text-xl font-semibold mb-4">
                  Possible Conditions
                </h2>
                {result.conditions?.map((condition) => (
                  <div
                    key={condition.id}
                    className="mb-4 p-3 bg-gray-50 rounded"
                  >
                    <p className="font-medium text-lg">{condition.name}</p>
                    <p className="text-sm text-gray-600">
                      Probability: {Math.round(condition.probability * 100)}%
                    </p>
                    <p className="text-sm text-gray-600 mt-1">
                      Recommendation: {condition.recommendation}
                    </p>
                  </div>
                ))}
                <div className="mt-4 p-4 bg-yellow-50 rounded-lg">
                  <p className="text-sm text-yellow-800 font-medium">
                    Important Note
                  </p>
                  <p className="text-sm text-yellow-700">
                    This is not a medical diagnosis. Always consult with a
                    qualified healthcare provider for proper medical advice.
                  </p>
                </div>
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Symptoms;
